import './App.css';
import Signup from './component/Signup';
import Login from './component/Login';
import {Routes,Route} from "react-router-dom"


function App() {
  return (
    <>
    <Routes>
    <Route path='' element={<Signup/>}/>
    <Route path='' element={<Login/>}/>
    </Routes>
    </>
  );
}

export default App;
